import React, {Component} from 'react'
import './Header.css'

class Header extends Component {
    render() {
        return (
            <div className="container">
                <div className="headerKu">
                    <span className="mr-2"><a href="#">Login</a></span>
                    <span><a href="#">Register</a></span>
                </div>
            </div>
        )
    }
}

export default Header
